import React, { useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { useAuth } from '../contexts/AuthContext';
import Layout from '../components/Layout';
import Card from '../components/Card';
import Table from '../components/Table';
import Badge from '../components/Badge';

const StudentAttendanceHistory = () => {
  const { currentUser, userRole, loading } = useAuth();
  const navigate = useNavigate();

  useEffect(() => {
    if (loading) return;
    
    if (!currentUser || userRole !== 'student') {
      navigate('/student');
      return;
    }
  }, [currentUser, userRole, loading, navigate]);

  if (loading) return <div>Loading...</div>;
  if (!currentUser || userRole !== 'student') return null;

  const attendanceData = [
    { id: 1, class: 'Advanced Web Dev', date: '2025-12-18', time: '09:15', status: 'present', gps_distance: '45m' },
    { id: 2, class: 'Database Design', date: '2025-12-18', time: '10:35', status: 'late', gps_distance: '38m' },
    { id: 3, class: 'Python Programming', date: '2025-12-17', time: '14:00', status: 'present', gps_distance: '52m' },
    { id: 4, class: 'Mobile App Dev', date: '2025-12-17', time: '11:00', status: 'absent', gps_distance: '620m' },
    { id: 5, class: 'Web Design', date: '2025-12-16', time: '15:30', status: 'present', gps_distance: '41m' },
    { id: 6, class: 'API Development', date: '2025-12-16', time: '13:00', status: 'present', gps_distance: '36m' },
  ];

  const stats = {
    total: 20,
    present: 18,
    late: 1,
    absent: 1
  };

  return (
    <Layout role="student">
      <div className="space-y-8">
        <div>
          <h1 className="text-3xl font-bold mb-2">Attendance History</h1>
          <p className="text-gray-600">View your attendance records and GPS geofence verification</p>
        </div>

        {/* Statistics Cards */}
        <div className="grid grid-cols-2 lg:grid-cols-4 gap-4">
          <Card>
            <div className="text-center">
              <p className="text-3xl font-bold text-blue-600">{stats.total}</p>
              <p className="text-sm text-gray-600 mt-2">Total Sessions</p>
            </div>
          </Card>
          <Card>
            <div className="text-center">
              <p className="text-3xl font-bold text-green-600">{stats.present}</p>
              <p className="text-sm text-gray-600 mt-2">Present</p>
            </div>
          </Card>
          <Card>
            <div className="text-center">
              <p className="text-3xl font-bold text-amber-600">{stats.late}</p>
              <p className="text-sm text-gray-600 mt-2">Late</p>
            </div>
          </Card>
          <Card>
            <div className="text-center">
              <p className="text-3xl font-bold text-red-600">{stats.absent}</p>
              <p className="text-sm text-gray-600 mt-2">Absent</p>
            </div>
          </Card>
        </div>

        {/* Attendance Table */}
        <Card title="ðŸ“‹ Detailed History">
          <Table
            columns={[
              { key: 'class', label: 'Class' },
              { key: 'date', label: 'Date' },
              { key: 'time', label: 'Time' },
              { key: 'gps_distance', label: 'Distance from Campus' },
              {
                key: 'status',
                label: 'Status',
                render: (status) => <Badge label={status.toUpperCase()} variant={status} />,
              },
            ]}
            data={attendanceData}
            searchable
            paginated
            itemsPerPage={10}
          />
        </Card>
      </div>
    </Layout>
  );
};

export default StudentAttendanceHistory;
